import React from 'react';
import TextField from '@material-ui/core/TextField';
import { Grid,Box,Typography } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import Map1 from '../../components/Map';
import { contactData } from '../../DATA';
import img2 from '../../images/contact/ccontact1.jpg'
import './ContactPage.css';
import { Email, Home, Phone, Twitter, Instagram, Facebook } from '@material-ui/icons';

const useStyles = makeStyles((theme) => ({
  form: {
    display:'flex',
    flexDirection:'column',
    width: '90%',
    padding: 20,
    marginTop: 20,
    "& .MuiInput-underline:before": {
      borderBottom: "2px solid grey"
    },
    "& .MuiInput-underline:after": {
      borderBottom: "2px solid yellow"
    },
    "& .MuiInput-underline:hover:before": {
      borderBottom: "2px solid green"
    },
    ['@media (max-width:598px)']: {
      marginTop:"30px",
    }
  },
  input: {
    '&:after': {
      borderBottom:"2px solid #1e1e27",
      },   
  },

}));

const Contact = () => {
  const classes = useStyles();
  return (
    <Grid id="contact">
      <Grid container xs={12}>
        <Grid item xs={12} md={6} className="contact-backgroundFix">
          <h1>contact us</h1>
        </Grid>
        <Grid item container xs={12} md={6} className="contact-grid-form">
          <div className="contact-form-container">      
            <form className={classes.form}>                  
              <TextField
                name="fullname"
                label="Full Name"
                type="text"
                InputProps={{
                  className: classes.input,
                }}
              />
              <TextField
                name="email"
                label="Email"
                type="email"
                InputProps={{
                  className: classes.input,
                }}
              />
              <TextField
                label="Type your Message"
                multiline
                rows={4}
                maxRows={4}
                InputProps={{
                  className: classes.input,
                }}
              />                   
              <button type='submit'>
                SEND
              </button>
            </form> 
          </div>
        </Grid>
      </Grid>
      <Grid container xs={12}>    
        <Grid item xs={12} md={6} className="contact-grid-info">
          <div className="left-title-container">
            <h1>
              shoptemplate
            </h1>
          </div>
          <div className="info-container">
            <div>
              <Email className="icon" />
              <p>shop@email.com</p>
            </div>
            <div>
              <Home className="icon" />
              <p>shop/adress</p>
            </div>
            <div>
              <Phone className="icon" />
              <p>00.25.556.1452</p>
            </div>
          </div>
        </Grid>
        <Grid item xs={12} md={6} className="contact-backgroundFix">
          <div className="contact-folow-container">
            <h1>folow us</h1>
            <div>
              <a><Facebook className="icon" /></a>
              <a><Instagram className="icon" /></a>
              <a><Twitter className="icon" /></a>        
            </div>
          </div>
        </Grid>
      </Grid>
      <Map1 />
      <Grid container xs={12} className="contact-backgroundFix"/>
    </Grid>
  );
};

export default Contact;


